import React from "react";
import { Card } from "react-bootstrap";
import logo from "../assets/jmlogo.png";
const MainPage = () => {
  return (
    <>
      <div className="h-100 ml-1 mr-1">
        <Card className="bg-transparent text-black">
          <Card.Img src={logo} width={100} height="100%" alt="Card image" />
          <Card.ImgOverlay>
            <Card.Title className="align-center">
              Something for everyone
            </Card.Title>
          </Card.ImgOverlay>
        </Card>
      </div>
    </>
  );
};

export default MainPage;
